var AppDispatcher = require('../app_dispatcher');
var ActionType = require('../action_type');

var EventEmitter = require('events').EventEmitter;
var Immutable = require('immutable');

const _stores = {};
const UPDATE_EVENT = "update_event";

class CommonStore extends EventEmitter{
  constructor(){
    super();
    this._data = Immutable.Map();
  }

  update(new_data){
    //update(updater: (value: Map<K, V>) => Map<K, V>): Map<K, V>
    this._data = this._data.update(Immutable.Map(new_data));
    this.emitChange();
  }

  set(k, v){
    this._data = this._data.set(k, v);
    this.emitChange();
  }

  delete(k){
    this._data = this._data.delete(k);
    this.emitChange();
  }

  get(k){
    return this._data.get(k);
  }

  getData(){
    return this._data;
  }

  emitChange() {
    this.emit(UPDATE_EVENT);
  }


  addEventListener(callback) {
    this.on(UPDATE_EVENT, callback);
  }

  /**
   * @param {function} callback
   */
  removeEventListener(callback) {
    this.removeListener(UPDATE_EVENT, callback);
  }
}


class StoreFactory{

  getOrCreateStore(store_id){
    if(!_stores[store_id])
      _stores[store_id] = new CommonStore();
    return _stores[store_id];
  }
}

let instance = new StoreFactory();

AppDispatcher.register(function(action) {
  var store_id = action.store_id;

  switch(action.actionType) {
    case ActionType.STORE_UPDATE:
    instance.getOrCreateStore(store_id).update(action.data);    
    break;

    case ActionType.STORE_SET:
    instance.getOrCreateStore(store_id).set(action.key, action.value);    
    break;

    case ActionType.STORE_DELETE:
    instance.getOrCreateStore(store_id).delete(action.key);    
    break;

    default:
      // no op
  }
});



export default instance;

